v = ""
w = ""
import math
def edit_distance(v,w):
    s = {}
    for i in range(len(v)+1):
        s[i,0] = i
    for j in range(len(w)+1):
        s[0,j] = j

    for i in range(1,len(v)+1):
        for j in range(1,len(w)+1):
            if(v[i-1] != w[j-1]):
                s[i,j] = min(s[i-1,j]+1,s[i,j-1]+1,s[i-1,j-1]+1) 
            elif(v[i-1] == w[j-1]):
                s[i,j] = s[i-1,j-1]
    count = math.inf
    for i in range(0,len(w)+1):
        if(s[len(v),i] < count):
            count = s[len(v),i]
    return count
        
    
print(edit_distance(v,w))
